import HomeCards from "../components/HomeCards";

export class Home extends Component {
  render() {
    return (
      <div>
        <img class="loader" src={require("../img/avalanche.gif")}></img>
        {/* <Menu></Menu> */}
        <Header></Header>
        <p>Here I have some text for testing. Lorem ipsum blah blah blah.</p>
        <HomeCards></HomeCards>

        {/* <Slideshow></Slideshow> */}
        <Footer></Footer>
      </div>
    );
  }
}

export default Home;
